import { Box, Typography } from '@mui/material'
import React from 'react'
import Link from '@mui/material/Link';

function Copyright(props) {


    return (
        <Typography variant="body2" color="text.secondary" align="center" {...props}>
            {'Copyright © '}
            <Link color="inherit" href="">
                Your Website
            </Link>{' '}
            {new Date().getFullYear()}
            {'.'}
        </Typography>
    );
}

function footer() {
    return (
        <Box sx={{
            position: 'relative',
            width:'100%',
            mt:'2rem',
            mb:'2rem'
        }}>
            <hr />
            <Box sx={{
                position: 'relative',
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center',
                mr: '4rem',
                ml: '4rem'
            }}>
                <Box>
                    <Box sx={{width:'4rem',height:'4rem'}} style={{ backgroundImage: `url(${process.env.PUBLIC_URL + '/logo_header.png'})` }}></Box>
                    <Copyright />
                </Box>
                <Box>
                    <Typography>The Journey To Pickle Hut</Typography>
                    <Typography>You can find taste home made pickle herewith us</Typography>
                    <Box>social media</Box>
                </Box>
            </Box>
        </Box>
    )
}

export default footer
